import React from 'react';
import styled from 'styled-components';

import iconeCerto from "./img/icone_certo.png"
import iconeErro from "./img/icone_erro.png"
import iconeQuase from "./img/icone_quase.png"
import logo from "./img/logo.png"
import party from "./img/party.png"
import sad from "./img/sad.png"
import setaPlay from "./img/seta_play.png"
import setaVirar from "./img/seta_virar.png"



export default function App() {
return(

<Container>
<Logo>
<LogoImg src={logo} alt=""/>
<LogoTetx >ZappRecall</LogoTetx>

</Logo>

<div className="logo-container"></div>
<img src={iconeCerto} alt=""/>
<img src={iconeErro} alt=""/>
<img src={iconeQuase} alt=""/>
<img src={party} alt=""/>
<img src={sad} alt=""/>
<img src={setaPlay} alt=""/>
<img src={setaVirar} alt=""/>


</Container>
)

}
const Container = styled.div`
    background-color: #FB6B6B;
    width: 100vw;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    margin: 0px;
    padding: 0px;
    padding-bottom: 200px;
  `;

const Logo = styled.div`
    display: flex;
    align-items: center;
    margin: 40px 0 20px 0; 
  `

const LogoImg = styled.img`
    width: 52px;
`

const LogoTetx =  styled.div`
    font-family: 'Righteous';
    font-style: normal;
    font-weight: 400;
    font-size: 36px;
    line-height: 45px;
    color: #FFFFFF;
    margin-left: 20px;
  `


